import React, { useContext } from 'react'
import { Link } from 'react-router-dom';
import { UserContext } from '../../UserContext'
const Home = () => {
    const {user,setUser}=useContext(UserContext);
    const setjohn=()=>{
        const john={
            name:"john",
            email:"john@gmail.com",
            password:"123",
            id:"345"
        }
        setUser(john)
        console.log(user)
    }
    const setTom=()=>{
        const tom={
            name:"tom",
            email:"tom@gmail.com",
            password:"456",
            id:"468"
        }
        setUser(tom)
    }
    return (
        <div>

<div class="row">
    <div class="col s12 m6">
      <div class="card blue-grey darken-1">
        <div class="card-content white-text">
          <span class="card-title">Welcome {user ? user.name:""}</span>
        </div>
        <div class="card-action">
        <button onClick={setjohn} >Set as john</button>
            <button onClick={setTom} >Set as tom</button>
        </div>
      </div>
    </div>
  </div>

        <Link to="/chat">
         <button>Goto chat</button>
        </Link>
        </div>
    )
}

export default Home
